import React from 'react';

const TaskList = (props) => {
  // Responsable On Get The Data In The Form (( Get Request))

  return (
    <>
      <section>
        <div>
          {props.Inputs.map((input) => (
            <div>
              <h3>{input.taskDetails}</h3>
              <p> {input.taskDate}</p>
            </div>
          ))}

          <button>Delete</button>
        </div>
      </section>
    </>
  );
};

export default TaskList;
